import React, { useState } from 'react'
import './MySkills.css'
import LinearProgress from '@material-ui/core/LinearProgress';
import { withStyles } from '@material-ui/core/styles';









const BorderLinearProgress = withStyles((theme) => ({
    root: {
      height: 12,
      borderRadius: 5,
    },
    colorPrimary: {
      backgroundColor: theme.palette.grey[theme.palette.type === 'light' ? 200 : 700],
    },
    bar: {
      borderRadius: 5,
      backgroundColor: '#1a90ff',
    },
  }))(LinearProgress);







{/* <i class="fab fa-bootstrap"></i> */}

export default function MySkills() {


    const [Html, setHtml] = useState("90")
    const [Css, setCss] = useState("90")
    const [JavaScript, setJavascript] = useState("90")
    const [React, setReact] = useState("90")
    const [NodeJs, setNodeJs] = useState("90")
    const [Mongodb, setMongodb] = useState("90")
    const [StopLoop, setStopLoop] = useState(200)

    if(StopLoop === 200){
        setHtml()
        setCss()
        setJavascript()
        set
    }





    return (
        <div className="MySkills-parents">
            <div className="html bar one">
                <div className="skills-icon"><i class="fab fa-html5 fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={Html} />  <p> {Html}% </p>
                </div> 
            </div>

            

            
            <div className="css bar two">
                <div className="skills-icon"><i class="fab fa-css3-alt fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={85} />  <p> 85% </p>
                </div> 
            </div>

            
            <div className="javaScript bar one">
                <div className="skills-icon"><i class="fab fa-js-square fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={70} />  <p> 70% </p>
                </div> 
            </div>

            
            <div className="react bar two">
                <div className="skills-icon"><i class="fab fa-react fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={70} />  <p> 70% </p>
                </div> 
            </div>

            
            <div className="nodeJs bar one">
                <div className="skills-icon"><i class="fab fa-node fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={85} />  <p> 85% </p>
                </div> 
            </div>

            
            <div className="mongodb bar two">
                <div className="skills-icon"><i class="fab fa-mdb fa-4x"></i>  </div>
                    <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={80} />  <p> 80% </p>
                </div> 
            </div>
        </div>
    )
}
